<?phpnamespace Drupal\seoer\Controller;use Drupal\Core\Controller\ControllerBase;use Drupal\system\SystemManager;use Symfony\Component\DependencyInjection\ContainerInterface;class SeoerController extends ControllerBase {  /**   * System Manager Service.   *   * @var \Drupal\system\SystemManager   */  protected $systemManager;  public function __construct(SystemManager $systemManager) {    $this->systemManager = $systemManager;  }  public static function create(ContainerInterface $container) {    return new static(      $container->get('system.manager')    );  }  public function getWorkbench() {    return ['#markup' => 'workbench'];  }  public function systemSeoMenuBlockPage() {    return $this->systemManager->getBlockContents();  }}